import React,{useState, useEffect} from 'react';
import axios from 'axios';
import {
    Card, CardImg, CardText, CardBody,
    CardTitle, CardSubtitle, Button, Alert
  } from 'reactstrap';

function Laurea() {

    const [loaded, setLoaded] = useState(false);
    const [item, setItem] = useState([]);

    var errAlert;

    useEffect(() => {
        fetchItems();
      },[]);

      const fetchItems = async () => {
          await axios.get("http://localhost:5000/api/items/laurea")
            .then(res => {
                console.log(res.data);
                setLoaded(true);
            })
            .catch(err => {
                console.log(err);
            });
      }

    return (
        <div>
            <h1 className="text-center mt-5">Laurea</h1>
            {(!loaded) && (
                <div className="row">
                    <p className="text-center">Fetching items...</p>
                </div>
            )}
        </div>
    );
}

export default Laurea;
